import React, {Component} from 'react';

import './Footer.css';

class Footer extends Component {
  render() {
    return (
      <div className="row" id="footer">
        <div className="medium-12 columns">
          <p style={{color:"white"}}>(C) Soravit Varanich Production </p>
        </div>
      </div>
    );
  }
}

export default Footer;
